import React, { useState } from "react";
import { FaFootballBall, FaBasketballBall, FaSwimmer, FaTennis, FaMapMarkerAlt, FaCalendarAlt } from "react-icons/fa";

const SearchBar = () => {
  const [activity, setActivity] = useState("");
  const [location, setLocation] = useState("");
  const [date, setDate] = useState("");

  const handleSearch = () => {
    console.log("Recherche effectuÃ©e avec :", { activity, location, date });
    // Ajoutez ici la logique de recherche
  };

  return (
    <div className="bg-white p-8 rounded-lg shadow-xl max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-6 text-gray-800">Rechercher un terrain</h2>
      <div className="flex flex-col md:flex-row gap-4">
        {/* SÃ©lecteur d'activitÃ© */}
        <div className="relative w-full md:w-1/4">
          <select
            value={activity}
            onChange={(e) => setActivity(e.target.value)}
            className="border p-3 rounded-lg w-full pl-10 focus:outline-none focus:ring-2 focus:ring-emerald-500"
          >
            <option value="">ActivitÃ©</option>
            <option value="natation">Natation</option>
            <option value="football">Football</option>
            <option value="basketball">Basketball</option>
            <option value="tennis">Tennis</option>
          </select>
          <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
            {activity === "natation" && <FaSwimmer className="text-gray-500 cursor-pointer" />}
            {activity === "football" && <FaFootballBall className="text-gray-500 cursor-pointer" />}
            {activity === "basketball" && <FaBasketballBall className="text-gray-500 cursor-pointer" />}
            {activity === "tennis" && <FaTennis className="text-gray-500 cursor-pointer" />}
            {!activity && <FaFootballBall className="text-gray-500 cursor-pointer" />}
          </div>
        </div>

        {/* SÃ©lecteur de localisation */}
        <div className="relative w-full md:w-1/4">
          <select
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="border p-3 rounded-lg w-full pl-10 focus:outline-none focus:ring-2 focus:ring-emerald-500"
          >
            <option value="">Localisation</option>
            <option value="tunis">Tunis</option>
            <option value="ariana">Ariana</option>
            <option value="ben_arous">Ben Arous</option>
            <option value="mannouba">Manouba</option>
          </select>
          <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
            <FaMapMarkerAlt className="text-gray-500 cursor-pointer" />
          </div>
        </div>

        {/* SÃ©lecteur de date */}
        <div className="relative w-full md:w-1/4">
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="border p-3 rounded-lg w-full pl-10 focus:outline-none focus:ring-2 focus:ring-emerald-500"
          />
          <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
            <FaCalendarAlt className="text-gray-500 cursor-pointer" />
          </div>
        </div>

        {/* Bouton de recherche */}
        <button
          onClick={handleSearch}
          className="bg-emerald-600 text-white px-6 py-3 rounded-lg hover:bg-emerald-700 transition-all duration-200 w-full md:w-auto"
        >
          ð Rechercher
        </button>
      </div>
    </div>
  );
};

export default SearchBar;
